import React from "react";
import classes from "./TodoItems.module.css";

const TodoItems = ({ todos, setTodos }) => {
  return (
    <div>
      {todos.map((todo) => (
        <div key={todo.id}>
          <input
            type="text"
            value={todo.title}
            onChange={(e) => e.preventDefault()}
            className={classes.todoItems}
          />
          <div>
            <button>
              {" "}
              <i class="fa-solid fa-user">sad</i>
            </button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default TodoItems;
